import{_ as a,o as t,c as e,R as p}from"./chunks/framework.E9w9IFh5.js";const m=JSON.parse('{"title":"登录","description":"","frontmatter":{"title":"登录","date":"2021-05-24T16:24:12.000Z"},"headers":[],"relativePath":"doc/wpdoc/登录.md","filePath":"doc/wpdoc/登录.md"}'),o={name:"doc/wpdoc/登录.md"},c=p('<h1 id="登录" tabindex="-1">登录 <a class="header-anchor" href="#登录" aria-label="Permalink to &quot;登录&quot;">​</a></h1><h2 id="账号开通" tabindex="-1">账号开通 <a class="header-anchor" href="#账号开通" aria-label="Permalink to &quot;账号开通&quot;">​</a></h2><p>目前IDE为内部使用程序，并未对外开放，如需使用先联系运维开通账号。账号信息包括所属项目、所属环境、账号、密码、使用者姓名。</p><h2 id="登录-1" tabindex="-1">登录 <a class="header-anchor" href="#登录-1" aria-label="Permalink to &quot;登录&quot;">​</a></h2><p>IDE的登录目前提供两种登录方式。中心登录与非中心登录，可通过右下角的切换按钮进行切换。</p><p>中心登录：为aPaaS平台统一管理账号密码，用户无需输入环境信息，中心会根据配置信息，自动匹配对应的环境及租户信息；</p><p>非中心登录：则个账号信息为各环境管理，需要先配置环境信息，才能匹配账号信息。</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/Picture3.png" alt=""></p><h3 id="中心登录-推荐" tabindex="-1">中心登录（推荐） <a class="header-anchor" href="#中心登录-推荐" aria-label="Permalink to &quot;中心登录（推荐）&quot;">​</a></h3><p>如下图所示，中心登录只需要输入正确的账号密码，默认匹配“生产环境”，点击登录按钮，即可登录。</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/Picture4.png" alt=""></p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/Picture5.png" alt=""></p><h3 id="非中心登录" tabindex="-1">非中心登录 <a class="header-anchor" href="#非中心登录" aria-label="Permalink to &quot;非中心登录&quot;">​</a></h3><p>先配置环境信息：点击环境信息选择右侧的配置icon，进入配置界面。</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/Picture6.png" alt=""></p><p>点击环境配置列表右上角的icon“ ”，新增环境信息，其中环境名称为必填。</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/Picture7.png" alt=""></p><p>输入正确的账号密码，选择对应的环境信息和开发模式，点击登录按钮，即可登录。</p><p><img src="http://apaas.wxchina.com:8881/wp-content/uploads/Picture8.png" alt=""></p>',19),n=[c];function r(i,s,h,l,d,_){return t(),e("div",null,n)}const P=a(o,[["render",r]]);export{m as __pageData,P as default};
